import React from "react";
import ExpenseItems from "./Components/ExpenseItems";
import { expenses } from "./Expenseitemsdata";
const App = () => {
  return (
    <div>
      {expenses.map((item) => (
        <div>
          <ExpenseItems items={item} />
        </div>
      ))}
    </div>
  );
};

export default App;
